import React from "react";

const Footer = () => {
  return (
    <footer className="App-footer">
      <div className="social-links">
        <a href='https://github.com/asaggse' target="_blank" rel="noopener noreferrer">
          <i class="devicon-github-original"></i>
        </a>
        <a href='https://linkedin.com/in/alessandro-saggese' target="_blank" rel="noopener noreferrer">
          <i class="devicon-linkedin-plain"></i>
        </a>
        <a href='https://twitter.com/asaggese_' target="_blank" rel="noopener noreferrer">
          <i class="devicon-twitter-original"></i>
        </a>
      </div>
      <p>Made by Alessandro Saggese with React</p>
    </footer>
  );
};

export default Footer;
